TEST(smithwaterman, c1){ // just to make sure that every line has been analysed


    SequenceCharToUInt8 sequenceCharToUInt8;
//    std::string seq1_string = "";
//    std::string seq2_string = "";
//    std::string seq1_string = "CGCGGCCGT CGGCGGGGCGAACACGAGTCGCCGGAATCT";
//    std::string seq2_string = "CGCGGC GTGCGGCGGGGCGAACACGAGTGGCCGGAA CCT";
//
    std::string seq1_string = "CGCGGCCGTCGGCGGGGCGAACACGAGTCGCCGGAATCT";
    std::string seq2_string = "CGCGGCGTGCGGCGGGGCGAACACGAGTGGCCGGAACCT";

    int8_t * seq1 = sequenceCharToUInt8.seq_to_int8(seq1_string);
    int8_t * seq2 = sequenceCharToUInt8.seq_to_int8(seq2_string);

    int32_t length1 = seq1_string.length();
    int32_t length2 = seq2_string.length();
    int matchingScore = 2;
    int mismatchingPenalty = -3;
    int openGapPenalty = -4;
    int extendGapPenalty = -2;

    Scorei m(matchingScore, mismatchingPenalty);
    int32_t maxScore;
    int32_t endPosition1;
    int32_t endPosition2;

    std::vector<uint32_t > cigar = SmithWaterman(seq1, seq2, length1, length2, openGapPenalty, extendGapPenalty,
                  maxScore, endPosition1, endPosition2, m, false, true);
    std::cout << "maxScore:" << maxScore << " endPosition1:" << endPosition1 << " endPosition2:" << endPosition2 << std::endl;
    for( int j=0; j<cigar.size(); ++j ){
        uint32_t cigarLength = cigar[j]>>4;
        uint32_t cigarType = cigar[j]&0xf;
        std::cout << cigarLength << "MID"[cigarType];
    }
    std::cout << std::endl;

    int8_t * seq1_rev_com = sequenceCharToUInt8.rev_comp(seq1, seq1_string.length());
    int8_t * seq2_rev_com = sequenceCharToUInt8.rev_comp(seq2, seq2_string.length());

    cigar = SmithWaterman(seq1_rev_com, seq2_rev_com, length1, length2, openGapPenalty, extendGapPenalty,
                                                 maxScore, endPosition1, endPosition2, m, true, true);
    std::cout << "maxScore:" << maxScore << " endPosition1:" << endPosition1 << " endPosition2:" << endPosition2 << std::endl;
    for( int j=0; j<cigar.size(); ++j ){
        uint32_t cigarLength = cigar[j]>>4;
        uint32_t cigarType = cigar[j]&0xf;
        std::cout << cigarLength << "MID"[cigarType];
    }
    std::cout << std::endl;

    ASSERT_EQ(0, 0);
}



